import { useState } from 'react'

const ButtonIncrement = ({}) => {
    const [count, setCount] = useState(0);

    const handleIncrement = () => {
        setCount( count + 1);
    };

    return (
        <button className="btn" onClick={ handleIncrement }>
            count = {count}
        </button>
    );
}

export default ButtonIncrement;
